import '../styles/App.css';
import Navbar from './Navbar';
import ContactList from './ContactList';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom/cjs/react-router-dom.min';


function App() {
  return (
    <Router>
      <div className="App">
      <div className="container">
        <Navbar />
        <Switch>
          <Route path='/'>
            <ContactList/>
          </Route>
        </Switch>
      </div>
    </div>
    </Router>
  );
}

export default App;
